import { Component, OnInit } from '@angular/core';
import { CommonFunctionService } from '../../../Services/CommonFunction/common-function.service';
import { ToastrService } from 'ngx-toastr';
import { LoaderService } from '../../../Services/Loader/loader.service';
import { ActivatedRoute, Router } from '@angular/router';
import { NgbModal } from '@ng-bootstrap/ng-bootstrap';
import { ViewPlacedStudentService } from '../../../Services/ViewPlacedStudent/View-placed-student.service';


@Component({
  selector: 'app-view-placed-student',
  templateUrl: './view-placed-student.component.html',
  styleUrls: ['./view-placed-student.component.css']
})
export class ViewPlacedStudentComponent implements OnInit {
  public Id: number = 0  
  public PlacedStudentList: any[] = [];
  public PlacementCompanyList: any[] = [];
  public key: number = 0
  constructor(private commonMasterService: CommonFunctionService, private ViewPlacedStudentService: ViewPlacedStudentService, private toastr: ToastrService, private loaderService: LoaderService, private activatedRoute: ActivatedRoute, private routers: Router, private modalService: NgbModal) {

  }

  async ngOnInit() {

    this.Id = Number(this.activatedRoute.snapshot.queryParamMap.get('post')?.toString());//postid
    this.key = Number(this.activatedRoute.snapshot.queryParamMap.get('key')?.toString());//student list key

    //edit
    if (this.Id > 0 && this.key > 0) {
      await this.GetAllData();
    }

  }

  // get detail by id
  async GetAllData() {
    try {
      this.loaderService.requestStarted();

      await this.ViewPlacedStudentService.GetAllData(this.Id, this.key)
        .then((data: any) => {
          data = JSON.parse(JSON.stringify(data));

          this.PlacedStudentList = data['Data'];
          console.log(this.PlacedStudentList)
          /* console.log(this.viewPlacementDashboardList);*/
        }, (error: any) => console.error(error)
        );
    }
    catch (ex) {
      console.log(ex);
    }
    finally {
      setTimeout(() => {
        this.loaderService.requestEnded();
      }, 200);
    }
  }
  printDiv(id: string) {
    var divToPrint = document.getElementById(id);
    var newWin = window.open('', 'Print-Window');
    newWin?.document.open();
    newWin?.document.write('<html><body onload="window.print()">' + divToPrint?.innerHTML + '</body></html>');
    newWin?.document.close();
    setTimeout(function () {
      newWin?.close();
    }, 10);
  }
}



<div class="container-fluid p-3 py-5 bg-primary text-white text-center">
  <h3 class="mt-0 text-white">{{key==2?"Short Listed Student Details":"Final Placed Student Details"}}</h3>
</div>

<div class="container-fluid AboutSection position-relative py-5" style="background: #deebff !important;">
  <img src="/assets/home/img/shape1.png" class="position-absolute shape2 left_image_bounce" />
  <div class="container-xl position-relative" style="z-index:9999">
    <div class="row">

      <div class="col-lg-12 col-md-12 col-sm-12 col-12">
        <div class="card">
          <div class="card-body">

            <div class="row">
              <div class="col-md-12 text-end mb-3">
                <a class="btn btn-primary btn-sm" href="/singlepost?post={{this.Id}}"><i class="fa fa-back"></i>Back</a>
                <button class="btn btn-primary btn-sm" type="button" (click)="printDiv('printable_div_id')" *ngIf="PlacedStudentList.length>0"><i class="fa fa-print me-1"></i>Print</button>
              </div>
              <div class="col-md-12" *ngIf="PlacedStudentList.length>0">

                <!--<div class="d-flex justify-content-between w-100 flex-wrap">
                  <span>No. of Vacancy: <i class="fa fa-user-o"></i>&nbsp;40</span>
                  <span>Campus Orgnize Date: <i class="fa fa-calendar-o"></i>&nbsp;10-10-2024 09:00AM</span>
                </div>-->
                <div class="table-responsive" id="printable_div_id">
                  <table class="table table-border w-full mb-0" cellpadding="5">
                    <thead class="bg-light/40 border-b border-gray-100 dark:bg-light/5 dark:border-b-gray-700 h-10">
                      <tr>
                        <th class="text-left">Student Name</th>
                        <th class="text-left">Enrollment No</th>
                        <th class="text-left">Institute Name</th>
                        <th class="text-left">Institute Type</th>
                        <!--<th class="text-left">Email</th>-->
                        <th class="text-left">Father Name</th>
                        <!--<th class="text-left">DOB</th>-->
                        <th class="text-left">Age</th>
                        <th class="text-left">Gender</th>
                        <!--<th class="text-left">Mobile No</th>-->
                      </tr>
                    </thead>
                    <tbody>
                      <tr *ngFor="let row of PlacedStudentList">

                        <td class="text-sm">{{row.StudentName}}</td>
                        <td class="text-sm">{{row.EnrollmentNo}}</td>
                        <td class="text-sm">{{row.InstituteName}}</td>

                        <td class="text-sm">{{row.InstitutionManagementType}}</td>
                        <!--<td class="text-sm text-center">{{row.Email}}</td>-->
                        <td class="text-sm">{{row.FatherName}}</td>
                        <!--<td class="text-sm">{{row.DOB}}</td>-->
                        <td class="text-sm">{{row.Age}}</td>
                        <td class="text-sm">{{row.Dis_Gender}}</td>
                        <!--<td class="text-sm">{{row.MobileNo}}</td>-->

                      </tr>
                    </tbody>
                  </table>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>

  </div>
</div>
